import React, { useEffect, useState } from "react";
import { useDispatch } from "react-redux";
import useFetch from "./common/useFetch";

const UsersListingComponent = () => {
  console.log("into users Listing");

  const [temp, setTemp] = useState([]);
  const [users, setUsers] = useState([]);
  const dispatch = useDispatch();

  const getDataFromAPI = async (url) => {
    const response = await fetch(url);
    console.log("response is : ", response[0]);

    setTemp(await response.json());
    console.log("user data : ", temp);
  };

  useEffect(() => {
    getDataFromAPI(
      "https://5c3ce12c29429300143fe570.mockapi.io/api/unregisteredusers"
    )
      .then(() => {
        temp.map((each) => {
          userData.id = each.id;
          userData.status = "UNREGISTERED";
          userData.project = "X";
          console.log(each);
          setUsers(...users, userData);
          console.log("userData after update  : ", users);
        });
        console.log("DATA FROM FETCH", temp);
      })
      .catch((error) => {
        console.log("ERROR while fetching data from API !!!", error);
      });
  }, []);

  return <div>Hi</div>;
};

export default UsersListingComponent;
